import React, { Component } from 'react';
import PropTypes from 'prop-types';

export class Navbar extends Component {
  static defaultProps = {
    title: 'GithubFinder',
  };

  static propTypes = {
    title: PropTypes.string.isRequired,
  };

  render() {
    const user = {
      firstName: 'stephen',
    };

    return (
      <div>
        <h1>{this.props.user.firstName}</h1>
      </div>
    );
  }
}

export default Navbar;
